import React from 'react';
import Slider from '../../components/slider/slider.component';
import SLIDER_DATA from '../../data/slider-data';
import Directory from '../../components/directory/directory.component';
import DIRECTORY_DATA from '../../data/directory.data';
import SpecialOffer from '../../components/special-offers/special-offer.componsnt';
import SPECIAL_OFFERS from '../../data/special-offers.data';

class Homepage extends React.Component {
  constructor() {
    super();

    this.state = {
      slider: SLIDER_DATA,
      directory: DIRECTORY_DATA,
      specialOffers: SPECIAL_OFFERS,
    };
  }

  render() {
    return (
      <div className="Homepage">
        <Slider slider={this.state.slider} />
        <Directory directory={this.state.directory} />
        <SpecialOffer spcialOffers={this.state.specialOffers} />
      </div>
    );
  }
}

export default Homepage;
